var app = angular.module('rmsdmgui.general.services');

app.service('PDFService', [function () {
	
	
	
	this.generateReceipt = function (receipt, address) {
		
		var date = new Date();
		var receiptPdf = new jsPDF({
			 orientation: 'p',
			 unit: 'mm',
			 format: 'letter'
			});
		var logo = 'data:image/jpeg;base64,';
		var signature = 'data:image/jpeg;base64,';
		var startingYPoint = 0;
		
		//This is to prevent the null value to appear in the address of the receipt
		address.address2 = (address.address2 == null || address.address2 == "") ? "" : address.address2;
		address.poBox = (address.poBox == null || address.poBox == "") ? "" : "P.O. Box: " + address.poBox;
		address.city = (address.city == null || address.city == "") ? "" : address.city;
		address.province = (address.province == null || address.province == "") ? "" : address.province;
		address.postalCode = (address.postalCode == null || address.postalCode == "") ? "" : address.postalCode;
				
		for(var i = 0; i <= 2; i++ ) {
			receiptPdf.addImage(logo, 'JPEG', 21, (startingYPoint + 8), 29, 29);
			receiptPdf.addImage(signature, 'JPEG', 141, (startingYPoint + 76), 42, 10);
			receiptPdf.setFont('Times New Roman', 'bold');
			receiptPdf.setFontSize(12);
			receiptPdf.text('Charitable Oraganization', 103, (startingYPoint + 15));
			receiptPdf.text('Thank You for your generous donation!', 125, (startingYPoint + 73));
			receiptPdf.setFontStyle('normal');
			receiptPdf.text('REDEMPTORIS MATER MISSIONARY SEMINARY', 78, (startingYPoint + 21));
			receiptPdf.text('ARCHDIOCESE OF TORONTO', 97, (startingYPoint + 27));
			receiptPdf.setFontSize(7);
			receiptPdf.text('Tel.: (416) 264-9477 | Fax: (416) 264-9783 | Business No.: 89075 5929 RR0001', 84, (startingYPoint + 32));
			receiptPdf.line(197, (startingYPoint + 35), 57, (startingYPoint + 35));	//line under seminary name
			receiptPdf.line(195, (startingYPoint + 85), 128, (startingYPoint + 85));	//line under signature
			for(var j = 1; j <= 279; j += 5) {
				if(startingYPoint != 0) {
					receiptPdf.line((j + 3), startingYPoint, j, startingYPoint);	//line between receipts
				}
			}
			receiptPdf.rect(16, (startingYPoint + 45), 101, 32);	//rectangle for the address
			receiptPdf.setFontSize(10);
			receiptPdf.text(['Please retain this receipt for Income Tax purposes.',
				'Canada Revenue Agency	www.canada.ca/charities-giving'], 17, (startingYPoint + 81));
			receiptPdf.setFontStyle('bold');
			receiptPdf.text('Receipt No.:	   ' + receipt.receiptNumber, 125, (startingYPoint + 53));
			receiptPdf.text('Taxation Year:	' + receipt.year, 125, (startingYPoint + 63));
			receiptPdf.setFontSize(11);
			receiptPdf.text('Amount Issued:	' + '$ ' + receipt.amount.toFixed(2).replace(/\d(?=(\d{3})+\.)/g, '$&,'), 125, (startingYPoint + 43));
			receiptPdf.setFontSize(10);
			receiptPdf.setFontStyle('normal');
			//This is the address of the receipt
			receiptPdf.text([receipt.taxReceiptName,//First line of the address
				address.address + ' ' + address.address2 + ' ' + address.poBox,//Second line of the address
				address.city + ' ' + address.province + ' ' + address.postalCode], 24, (startingYPoint + 58));//Third line of the address
			receiptPdf.text('Date Issued:	' + date.getDate() + '/' + (date.getMonth() + 1) + '/' + date.getFullYear(), 125, (startingYPoint + 58)); //fix the data of the date
			startingYPoint += 93;
		}

		receiptPdf.save('Receipt' + receipt.receiptNumber + '.pdf');
	}
	
	this.generateAllReceipts = function(receiptsArray) {
		
		var date = new Date();
		var receiptPdf = new jsPDF({
			 orientation: 'p',
			 unit: 'mm',
			 format: 'letter'
			});
		var logo = 'data:image/jpeg;base64,';
		var signature = 'data:image/jpeg;base64,';
		var startingYPoint = 0;
		
		for (var i = 0; i <= (receiptsArray.receipt.length - 1); i++) {
			//This is to prevent the null value to appear in the address of the receipt
			receiptsArray.address[i].address2 = (receiptsArray.address[i].address2 == null || receiptsArray.address[i].address2 == "") ? "" : receiptsArray.address[i].address2;
			receiptsArray.address[i].poBox = (receiptsArray.address[i].poBox == null || receiptsArray.address[i].poBox == "") ? "" : "P.O. Box: " + receiptsArray.address[i].poBox;
			receiptsArray.address[i].city = (receiptsArray.address[i].city == null || receiptsArray.address[i].city == "") ? "" : receiptsArray.address[i].city;
			receiptsArray.address[i].province = (receiptsArray.address[i].province == null || receiptsArray.address[i].province == "") ? "" : receiptsArray.address[i].province;
			receiptsArray.address[i].postalCode = (receiptsArray.address[i].postalCode == null || receiptsArray.address[i].postalCode == "") ? "" : receiptsArray.address[i].postalCode;
			
			for(var j = 0; j <= 2; j++ ) {
				receiptPdf.addImage(logo, 'JPEG', 21, (startingYPoint + 8), 29, 29);
				receiptPdf.addImage(signature, 'JPEG', 141, (startingYPoint + 76), 42, 10);
				receiptPdf.setFont('Times New Roman', 'bold');
				receiptPdf.setFontSize(12);
				receiptPdf.text('Charitable Oraganization', 103, (startingYPoint + 15));
				receiptPdf.text('Thank You for your generous donation!', 125, (startingYPoint + 73));
				receiptPdf.setFontStyle('normal');
				receiptPdf.text('REDEMPTORIS MATER MISSIONARY SEMINARY', 78, (startingYPoint + 21));
				receiptPdf.text('ARCHDIOCESE OF TORONTO', 97, (startingYPoint + 27));
				receiptPdf.setFontSize(7);
				receiptPdf.text('Tel.: (416) 264-9477 | Fax: (416) 264-9783 | Business No.: 89075 5929 RR0001', 84, (startingYPoint + 32));
				receiptPdf.line(197, (startingYPoint + 35), 57, (startingYPoint + 35));	//line under seminary name
				receiptPdf.line(195, (startingYPoint + 85), 128, (startingYPoint + 85));	//line under signature
				for(var k = 1; k <= 279; k += 5) {
					if(startingYPoint != 0) {
						receiptPdf.line((k + 3), startingYPoint, k, startingYPoint);	//line between receipts
					}
				}
				receiptPdf.rect(16, (startingYPoint + 45), 101, 32);	//rectangle for the address
				receiptPdf.setFontSize(10);
				receiptPdf.text(['Please retain this receipt for Income Tax purposes.',
					'Canada Revenue Agency	www.canada.ca/charities-giving'], 17, (startingYPoint + 81));
				receiptPdf.setFontStyle('bold');
				receiptPdf.text('Receipt No.:	   ' + receiptsArray.receipt[i].receiptNumber, 125, (startingYPoint + 53));
				receiptPdf.text('Taxation Year:	' + receiptsArray.receipt[i].year, 125, (startingYPoint + 63));
				receiptPdf.setFontSize(11);
				receiptPdf.text('Amount Issued:	' + '$ ' + receiptsArray.receipt[i].amount.toFixed(2).replace(/\d(?=(\d{3})+\.)/g, '$&,'), 125, (startingYPoint + 43));
				receiptPdf.setFontSize(10);
				receiptPdf.setFontStyle('normal');
				//This is the address of the receipt
				receiptPdf.text([receiptsArray.receipt[i].taxReceiptName,//First line of the address
					receiptsArray.address[i].address + ' ' + receiptsArray.address[i].address2 + ' ' + receiptsArray.address[i].poBox,//Second line of the address
					receiptsArray.address[i].city + ' ' + receiptsArray.address[i].province + ' ' + receiptsArray.address[i].postalCode], 24, (startingYPoint + 58));//Third line of the address
				receiptPdf.text('Date Issued:	' + date.getDate() + '/' + (date.getMonth() + 1) + '/' + date.getFullYear(), 125, (startingYPoint + 58)); //fix the data of the date
				startingYPoint += 93;
			}
			startingYPoint = 0;
			if (i < (receiptsArray.receipt.length - 1)) {
				receiptPdf.addPage();
			}
		}
		//The receipts are download many many times. It should download only one with all the pages
		receiptPdf.save('AllReceipts.pdf');
	}
	
}]);